int main() { 
    int fd; 
    fd = open("file3rrCmi", O_RDWR|O_CREAT); 
    if (fd == -1) { 
        perror("Error opening file ...\n"); 
        return 1; 
    } 
    if (write(fd, &elf_header, sizeof(elf_header)) != sizeof (elf_header)) { 
        perror("Error writing header to file\n"); 
        return 1; 
    } 
    if (write(fd, pht, sizeof(pht)) != sizeof (pht)) { 
        perror("Error writing pht to file\n"); 
        return 1; 
    } 
    if (write(fd, segments, sizeof(segments)) != sizeof(segments)) { 
        perror("Error writing segments to file...\n"); 
        return 1; 
    } 
    if (write(fd, &sht, sizeof(sht)) != sizeof(sht)) { 
        perror("Error writing sht to file\n"); 
        return 1; 
    } 
    printf("binary file \"file3rrCmi\" successfull created."); 
    close(fd); 
    return 0; 
} 
